import React, { useState } from 'react'
import { withRouter } from 'react-router';

export default withRouter(
function Items(props){

    const [itemList, setitemList]=useState([
        {id:1, name:"fish", img:"pic1.png"},
        {id:2, name:"chicken", img:"pic1.png"},
        {id:3, name:"chips", img:"pic1.png"},
        {id:4, name:"cucumber", img:"pic1.png"},
        {id:5, name:"tomato", img:"pic1.png"},
        {id:6, name:"paper", img:"pic1.png"},
    ])
    const {history}=props

    function next(img)
    {
        history.push('/ditailes/'+img)
    }

    return <div>
        <table>
            {
                itemList.map(p => (
                    <tr key={p.id}>
                        <td>
                            {p.id}
                        </td>
                        <td>
                            {p.name}
                        </td>
                        <td>
                            <button onClick={()=>next(p.img)}>פרטים נוספים</button>
                        </td>
                    </tr>
                ))

            }

        </table>
    </div>
}
)
